import {Component, Inject, Input, OnInit, Sanitizer} from '@angular/core';
import {AuthService} from "../auth/auth.service";
import {MAT_DIALOG_DATA, MatDialog, MatDialogRef, MatSnackBar} from "@angular/material";
import {AddProductDialog} from "../product/addproduct/add.product.component";
import {Product} from "../product/product";
import {ProductService} from "../product/product.service";
import * as _ from 'lodash';
import {DomSanitizer} from "@angular/platform-browser";
import {CartService} from "../cart/cart.service";
import {Cart} from "../cart/Cart";
import {CartProduct} from "../cart/CartProduct";


const PRODUCT_DATA: any[] = [
  {name: 'Car1', price: 1.0079, img: '../../assets/img/bentley.jpg', quantity:1},
  {name: 'Car2', price: 1.0079, img: '../../assets/img/maluch.jpg', quantity:1},
  {name: 'Car3', price: 1.0079, img: '../../assets/img/jeep.png', quantity:1},
];

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss']
})
export class HomeComponent implements OnInit {

  public user:any;
  public products : Product[];
  dataSource = PRODUCT_DATA;

  constructor(private productService:ProductService,
              private authService: AuthService,
              public dialog: MatDialog,
              private sanitizer: DomSanitizer,
              private cartService: CartService,
              private snackBar: MatSnackBar) {
    this.productService.getProducts()

      .subscribe(products =>{
      this.products = _.map(products, (product)=>{
        // var b64encoded = btoa(String.fromCharCode.apply(null, product.image.data));
        // var datajpg = "data:" + product.image.contentType + ";base64," + b64encoded;
        // this.base64Image = this._sanitizer.bypassSecurityTrustResourceUrl(datajpg);
        // var uints = new Uint8Array(product.image.data);
        // console.log(product.image);
        // var uints = new Uint8Array(product.image.data.data);
        // var base64 = btoa( String.fromCharCode.apply(null, uints));
        // // var base64 = btoa( String.fromCharCode.apply(null, product.image.data);
        // var url = 'data:image/png;base64,' + base64;
        // console.log(url);
        let imageData = "data:image/jpeg;base64,";
        let sanitzedImageData = this.sanitizer.bypassSecurityTrustUrl(imageData);
        product.img=sanitzedImageData;
        console.log(sanitzedImageData);
        return product;
      });

    });
  }

  addToCart(product):void {
    this.cartService.getCart().subscribe((cart:Cart)=>{
      if(cart){
        this.cartService.addProduct(cart._id, product).subscribe(data => {
          this.snackBar.open("Added to cart", null, {
            horizontalPosition:'end',
            duration: 2000,
          });
        });
      }else{
        this.cartService.createCart(product, _.get(this.user, "_id")).subscribe(data => {
          this.snackBar.open("Added to cart", null, {
            horizontalPosition:'end',
            duration: 2000,
          });
        });
      }

    });
  };

  openAddDialog(): void {
    const dialogRef = this.dialog.open(AddProductDialog, {
      width: '400px'
    });

    dialogRef.afterClosed().subscribe(result => {
      console.log('The dialog was closed');
    });
  }

  removeProduct(product:Product):void{

    this.productService.deleteProduct(product._id).subscribe((product:Product)=>{
        if(product){
          this.products = _.reject(this.products,(listItem)=>{
            return listItem._id == product._id;
          });
        }
    });

  }

  editProduct(product:Product):void{

    const dialogRef = this.dialog.open(AddProductDialog, {
      width: '400px'
    });

    dialogRef.afterClosed().subscribe(result => {
      console.log('The dialog was closed');
    });

  }

  ngOnInit() {
    this.dataSource = PRODUCT_DATA;
    this.authService.me().subscribe(data => {
      this.user = data.user;
    });

  }

}

